import React from 'react'

export default function ProductCard({products, logo, title, price}) {
  console.log('products logo ', products.logo)
  return (
    <div className='justify-center items-center border-2 inline-block p-10'>
        <div className='inline-block'>
         <img src={logo} alt="" />

        </div>

        <p className='product-name'>Greyhound Hoodie {title}</p>
        <p className='product-price'>${price}</p>
    </div>
  )
}
